 import {
  GoogleMapProvider,
  useGoogleMap,
 } from "@ubilabs/google-maps-react-hooks";

 const mapOptions = {
  zoom: 12,
  center: {
    lat: 50.7521, 
    lng: 2.7001
  },
};

 export default function MapOfGoogle() {

  

  return(
    <div>
      <GoogleMapProvider
        googleMapsApiKey= "AIzaSyDpSrQ5Ey93gZgzhAWp0AlGAa351IUkUOI"
        options={mapOptions}
      ></GoogleMapProvider>
      <div></div>
    </div>
  )

 }


